import React, { Fragment } from 'react'
import GoogleIcon from '@mui/icons-material/Google';
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import WhatsAppIcon from '@mui/icons-material/WhatsApp';
import '../css/Home.css'


function Home() {
  return (
    <Fragment>
          <section id='home' className='pd-y'>
        <div className='container'> 
        <div className="row">
            <div className="col-md-6 col-12 home-text">
                <h1>beta academy</h1>
                <p>training center that aims to develop student's skills in technical and non-technical in all engineering fields.</p>
                <div className='social-icons'>
                  <a href='#'> <GoogleIcon className='icon g'></GoogleIcon> </a>
                  <a href='#'> <FacebookIcon className='icon fb'></FacebookIcon> </a>
                  <a href='#'> <InstagramIcon className='icon fb'></InstagramIcon> </a>
                  <a href='#'> <LinkedInIcon className='icon fb'></LinkedInIcon> </a>
                  <a href='#'> <WhatsAppIcon className='icon fb'></WhatsAppIcon> </a>
                </div>
            </div> {/* ./home-text */}
            <div className='col-md-5 col-12 home-img'>
              <div className='layer'></div>
              </div> {/* ./img */}
        </div> {/* ./row */}
        </div> {/*./container */}
    </section>
    {/* ./home */}
    <div className="divider"></div>
    <section className="courses text-center mt-5 pd-y">
      <div className="container">
      <h1> courses will be here !!  </h1>
      </div>
    </section>
    {/* ./courses */}
    </Fragment>
  )
}

export default Home
